import { useState } from "react";

function App() {
  const [toDo, setTodo] = useState("");
  const onChange = (event) => setTodo(event.target.value);
  console.log(toDo);

  return (
    <div>
      <form>
        <input value={toDo} onChange={onChange} type="text" placeholder="Write your todo ... " />
        <button>Add TODO</button>
      </form>
    </div>
  );
}

export default App;
